script: |
  super -f text -I q4376.spq | sort > q4376.out

inputs:
  - name: q4376.spq
    data: |
      SELECT ALL ( + col0 ) FROM tab1 (FORMAT parquet) WHERE NOT ( col1 * + col0 ) BETWEEN ( - col2 + + col2 * col0 ) AND ( col0 * - 24 );
  - name: tab1

outputs:
  - name: q4376.out
    data: |
      51
      85
      91
